import React from 'react';
import { IonContent, IonItem, IonLabel, IonButton, IonNote, IonList, IonGrid, IonRow, IonCol, IonChip, IonCard, IonCardHeader, IonCardContent, IonCardTitle, IonHeader, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import { RouteComponentProps } from 'react-router';
import Student from '../components/Student';
import Club from '../components/Club';
import Event from '../components/Event';
import './UserSettings.css';

import john from '../images/john.jpg'
import ice from '../images/rsz_ice_cream.jpg'

let test_student = new Student("Carter", "Cromer", 1, "Cal Poly SLO", "ccromer@calpoly.edu", ["social", "recreation", "outdoors", "athletic", "games"]);
let test_club = new Club("Ice Cream Club", 1, "A club for people who like Ice Cream", ice, john, [], "Cal Poly SLO", [], undefined, [], [])

  let test_event = new Event(test_club, 1, "Eat ice cream angrily", "August 22", john, "Agressive Ice Cream Eating", "October 29", "12PM - 5PM", "Kennedy Lawn");

interface MatchParams {
  name: string;
}

const ClubProfile: React.FC<RouteComponentProps<MatchParams>> = (props) => {

  let name = props.match.params.name;

  return (
  <IonPage>
    <IonHeader>
      <IonToolbar>
        <IonTitle>{name}</IonTitle>
      </IonToolbar>
    </IonHeader>
    <IonContent fullscreen>
      
      

    </IonContent>
  </IonPage>
  );
};

export default ClubProfile;
